u change the setting, it will apply to this and all child groups, components and content. Note that <em>Denied</em> will overrule any inherited setting, and also the setting in any child group, component or content. In the case of a setting conflict, <em>Deny</em> will take precedence. <em>Not Set</em> is equivalent to <em>Denied</em> but can be changed in child groups, components and content.<br />2. If you select a new setting, click <em>Save</em> to refresh the calculated settings.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.lib_joomla.ini'),(1865,'JLIB_RULES_SETTING_NOTES_ITEM','1. If you change the setting, it will apply to this item. Note that:<br /><em>Inherited</em> means that the permissions from global configuration, parent group and category will be used.<br /><em>Denied</em> means that no matter what the global configuration, parent group or category settings are, the group being edited cannot take this action on this item.<br /><em>Allowed</em> means that the group being edited will be able to take this action for this item (but if this is in conflict with the global configuration, parent group or category it will have no impact; a conflict will be indicated by <em>Not Allowed (Locked)</em> under Calculated Settings).<br />2. If you select a new setting, click <em>Save</em> to refresh the calculated settings.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.lib_joomla.ini'),(1866,'JLIB_RULES_SETTINGS_DESC','Manage the permission settings for the user groups below. See notes at the bottom.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.lib_joomla.ini'),(1867,'JLIB_UNKNOWN','Unknown','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.lib_joomla.ini'),(1868,'JLIB_UPDATER_ERROR_COLLECTION_FOPEN','The PHP allow_url_fopen setting is disabled. This setting must be enabled for the updater to work.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.lib_joomla.ini'),(1869,'JLIB_UPDATER_ERROR_COLLECTION_OPEN_URL','Upd