\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2524,'MOD_LANGUAGES_FIELD_FOOTER_LABEL','Post-text','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2525,'MOD_LANGUAGES_FIELD_FULL_NAME_DESC','If set to \'Yes\' and image flags set to \'No\', full content language native names are displayed. If set to \'No\', upper case abbreviations from the content language\'s URL Language Code are used. Example: EN for English, FR for French.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2526,'MOD_LANGUAGES_FIELD_FULL_NAME_LABEL','Languages Full Names','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2527,'MOD_LANGUAGES_FIELD_HEADER_DESC','This is the text or HTML that is displayed above the language switcher','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2528,'MOD_LANGUAGES_FIELD_HEADER_LABEL','Pre-text','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2529,'MOD_LANGUAGES_FIELD_INLINE_DESC','Default is set to \'Yes\', i.e. to horizontal display.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2530,'MOD_LANGUAGES_FIELD_INLINE_LABEL','Horizontal Display','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2531,'MOD_LANGUAGES_FIELD_MODULE_LAYOUT_DESC','Use a different layout from the supplied module or overrides in the default template.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2532,'MOD_LANGUAGES_FIELD_USEIMAGE_DESC','If set to \'Yes\', will display language choice as image flags. Otherwise will use the content language native names.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2533,'MOD_LANGUAGES_FIELD_USEIMAGE_LABEL','Use Image Flags','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2534,'MOD_LANGUAGES_OPTION_DEFAULT_LANGUAGE','Default','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2535,'MOD_LANGUAGES_SPACERDROP_LABEL','<u>If Use Dropdown is set to \'Yes\', <br />the display options below will be ignored</u>','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2536,'MOD_LANGUAGES_SPACERNAME_LABEL','<u>If Use Image Flags is set to \'Yes\', <br />the display options below will be ignored</u>','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2537,'MOD_LANGUAGES_XML_DESCRIPTION','This module displays a list of available Content Languages (as defined and published in Language Manager Content tab) for switching between them when one wants to use Joomla! as a multilingual site. <br />--The plugin \'System - Language Filter\' has to be enabled.--<br /> When switching languages and if the item displayed in the page is not associated to another item, the module redirects to the Home page defined for the chosen language.<br /> Otherwise, if the parameter is set for the Language filter plugin, it will redirect to the associated item in the language chosen. Thereafter, the navigation will be the one defined for that language. <br />If the plugin <strong>\'System - Language Filter\'</strong> is disabled, this may have unwanted results.<br /><strong>Method:</strong><br />1. Open Language Manager Content tab and make sure the Languages you want to use in contents are published and have a Language Code for the URL as well as prefix for the image used in the module display.<br />2. Create a Home page by assigning a language to a menu item and defining it as Default Home page for each published content language. <br />  3. Thereafter, you can assign a language to any Article, Category, Module, Newsfeed, Weblinks in Joomla.<br /> 4. Make sure the module is published and the plugin is enabled. <br /> 5. When using associated items, make sure the module is displayed on the pages concerned. <br />6. The way the flags or names of the languages are displayed is defined by the ordering in the Language Manager - Content Languages.<br ><br >If this module is published, it is suggested to publish the administrator multilingual status module.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.ini'),(2538,'MOD_LANGUAGES','Language Switcher','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.sys.ini'),(2539,'MOD_LANGUAGES_XML_DESCRIPTION','This module displays a list of available Content Languages (as defined and published in Language Manager Content tab) for switching between them when one wants to use Joomla! as a multilingual site. <br />--The plugin \'System - Language Filter\' has to be enabled.--<br /> When switching languages and if the item displayed in the page is not associated to another item, the module redirects to the Home page defined for the chosen language.<br /> Otherwise, if the parameter is set for the Language filter plugin, it will redirect to the associated item in the language chosen. Thereafter, the navigation will be the one defined for that language. <br />If the plugin <strong>\'System - Language Filter\'</strong> is disabled, this may have unwanted results.<br /><strong>Method:</strong><br />1. Open Language Manager Content tab and make sure the Languages you want to use in contents are published and have a Language Code for the URL as well as prefix for the image used in the module display.<br />2. Create a Home page by assigning a language to a menu item and defining it as Default Home page for each published content language. <br />  3. Thereafter, you can assign a language to any Article, Category, Module, Newsfeed, Weblinks in Joomla.<br /> 4. Make sure the module is published and the plugin is enabled. <br /> 5. When using associated items, make sure the module is displayed on the pages concerned. <br />6. The way the flags or names of the languages are displayed is defined by the ordering in the Language Manager - Content Languages.<br ><br >If this module is published, it is suggested to publish the administrator multilingual status module.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.sys.ini'),(2540,'MOD_LANGUAGES_LAYOUT_DEFAULT','Default','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_languages.sys.ini'),(2541,'MOD_LOGIN','Login','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2542,'MOD_LOGIN_FIELD_GREETING_DESC','Show/Hide the simple greeting text','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2543,'MOD_LOGIN_FIELD_GREETING_LABEL','Show Greeting','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2544,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_DESC','Select the page the user will be redirected to after a successful login. Select from all the pages listed in the dropdown menu. Choosing \"Default\" will return to the same page.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2545,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_LABEL','Login Redirection Page','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2546,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_DESC','Select the page the user will be redirected to after successfully ending their current session by logging out. Select from all the pages listed in the dropdown menu. Choosing \"Default\" will return to the same page.','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2547,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_LABEL','Logout Redirection Page','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2548,'MOD_LOGIN_FIELD_NAME_DESC','Displays name or username after logging','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2549,'MOD_LOGIN_FIELD_NAME_LABEL','Show Name/Username','D:\\wamp\\www\\framework\\3.3.1\\language\\en-GB\\en-GB.mod_login.ini'),(2550,'MOD_LOGIN_FIELD_POST_TEXT_DESC','This is the text or HTML that is displayed below the login form.','D:\\wamp\\www\\fr